func TestKeys(t *testing.T) {
	text := []byte("The lunatics have taken over the asylum")
	text = append(text, 0)

	for _, kind := range []Kind{B1, B2, B3, B4} {
		entropy := newEntropy(seed, true)
		pk := newPrivateKey(kind, entropy)
		r := result[kind]
		if len(pk.s1) != len(r.s1) {
			t.Error("length of s1 is invalid", len(pk.s1), len(r.s1))
		}
		if len(pk.s2) != len(r.s2) {
			t.Error("length of s1 is invalid")
		}
		if len(pk.a) != len(r.a) {
			t.Error("length of s1 is invalid")
		}
		for i := range pk.s1 {
			if pk.s1[i] != r.s1[i] {
				t.Error("invalid s1")
			}
		}
		for i := range pk.s2 {
			if pk.s2[i] != r.s2[i] {
				t.Error("invalid s2")
			}
		}
		for i := range pk.a {
			if pk.a[i] != r.a[i] {
				t.Error("invalid a")
			}
		}
		pub := pk.PublicKey()
		if len(pub.a) != len(r.a) {
			t.Error("length of s1 is invalid")
		}
		for i := range pk.a {
			if pk.a[i] != r.a[i] {
				t.Error("invalid a")
			}
		}
		sig := pk.sign(text, entropy)
		rsig := resultSig[kind]
		if len(sig.z1) != len(rsig.z1) {
			t.Error("length of z1 is invalid")
		}
		if len(sig.z2) != len(rsig.z2) {
			t.Error("length of z2 is invalid")
		}
		if len(sig.c) != len(rsig.c) {
			t.Error("length of c is invalid")
		}
		for i := range sig.z1 {
			if sig.z1[i] != rsig.z1[i] {
				t.Error("invalid z1")
			}
		}
		for i := range sig.z2 {
			if sig.z2[i] != rsig.z2[i] {
				t.Error("invalid z2")
			}
		}
		for i := range sig.c {
			if sig.c[i] != rsig.c[i] {
				t.Error("invalid c")
			}
		}
		if err := pub.Verify(sig, text); err != nil {
			t.Error(err)
		}
		if err := pub.Verify(sig, []byte("moe")); err == nil {
			t.Error("should be failed")
		}
	}
}

